import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';
import './AboutMe.css'; // Import the new CSS file

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';
import './Aboutme.css'

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: '🌍 Renuem',
      description: (
        <ul className="ul">
          <li className="li">Developed a renewable energy investment app using React Native and Node.js.</li>
          <li className="li">Deployed the backend on AWS, integrating MySQL RDS for efficient data management.</li>
        </ul>
      ),
    },
    {
      id: '2024',
      icon: clearear,
      title: '💼 Clear Ear',
      description: (
        <ul className="ul">
          <li className="li">Designed an Android app using React Native for a hearing clinic.</li>
          <li className="li">Integrated a local database to track customer details and appointments.</li>
        </ul>
      ),
    },
  ];

  return (
    <div className={`main ${isMobileView ? '' : 'desktop-view'}`}>
      <div className={`hero-section ${isMobileView ? '' : 'desktop-view'}`}>
        <img src={untitled} alt="Mohammed" className={`image ${isMobileView ? '' : 'desktop-view'}`} />
        <div className={`paragraph ${isMobileView ? '' : 'desktop-view'}`}>
          <p>With over 7 years of experience as a Full Stack Developer...</p>
        </div>
      </div>

      <h3 className={`section-header ${isMobileView ? '' : 'desktop-view'}`}>Tech Languages</h3>
      <div className="logo-container">
        {techLanguages.map(({ id, src, name }) => (
          <div key={id} style={{ position: 'relative' }}>
            <img
              src={src}
              alt={name}
              className={`logo ${isMobileView ? '' : 'desktop-view'}`}
              onMouseEnter={() => handleLogoHover(id)}
              onMouseLeave={() => handleLogoLeave(id)}
            />
            <div className={`tooltip ${tooltipVisible[id] ? 'visible' : ''}`}>{name}</div>
          </div>
        ))}
      </div>

      <h3 className={`section-header ${isMobileView ? '' : 'desktop-view'}`}>Work History</h3>
      <Timeline>
        {workHistory.map(({ id, icon, title, description }) => (
          <TimelineItem key={id}>
            <TimelineOppositeContent>
              <img src={icon} alt={title} className={`image ${isMobileView ? '' : 'desktop-view'}`} />
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent>
              <Typography variant="h6">{title}</Typography>
              {description}
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
